const Navbar = () => {

  return (
    <nav className="navbar">
      <h2>Sneakers</h2>
      <div className="links">
        <a href="/">Collections</a>
        <a href="/">Men</a>
        <a href="/">Women</a>
        <a href="/">About</a>
        <a href="/">Contacts</a>
      </div>

    </nav>
  );
}

export default Navbar
